@nickster747 @DominicRaab @LordsEUCom @OllyRobbins The available options are Brexit in name only or #NoBrexit, with BINO meaning the U.K. loses it’s sovereignty and having no say in EU regulations, standards and ECJ rulings.
Yet, still being bound by the ECJ.
What is the point and why give up on our sovereignty?
